import React, { Component } from 'react';
import { useParams } from 'react-router-dom';


export default class Product extends Component {
    constructor(props) {
        super(props)
        
        this.state = {
            categories: []
        }
    }
    componentDidMount() {
        const params = useParams()
    }
    render(){
        const params = useParams()
        return ("hello this is product page")
    }
}
